import java.util.TreeSet;

public class Main {
    public static void main(String[] args) {
        TreeSet<Integer> treeSet = new TreeSet<>();

        // Add some initial elements
        treeSet.add(100);
        treeSet.add(200);
        treeSet.add(300);

        // Unrelated intermediate manipulations
        int variable = 42; 
        int flipper = (variable * 2) % 3;
        // Misleading modification
        if (flipper == 1) {
            treeSet.add(400);
        } else {
            treeSet.remove(200);
        }

        // Conditional logic affecting whether the write point executes
        if (flipper != 1) {
            /* write */ treeSet.add(150);
        }

        // More operations that do not affect the read
        treeSet.add(250);
        treeSet.remove(100);
        var dummySet = new TreeSet<>(treeSet.descendingSet()); // Just to confuse

        // Additional logic irrelevant to read
        if (dummySet.contains(300)) {
            dummySet.add(350);
        }
        dummySet.clear();

        /* read */ Integer ret = treeSet.higher(100); // 150 is greater than 100

        // Print the result of the read operation
        System.out.println("Read value: " + ret); 
    }
}
